#include <stdio.h>
#include <stdlib.h>

typedef struct Node {
    int key;
    struct Node* left;
    struct Node* right;
} Node;

Node* insert(Node* root, int key) {
    if (root == NULL) {
        root = (Node*)malloc(sizeof(Node));
        root->key = key;
        root->left = NULL;
        root->right = NULL;
    } else if (key < root->key) {
        root->left = insert(root->left, key);
    } else if (key > root->key) {
        root->right = insert(root->right, key);
    }
    return root;
}

Node* find(Node* root, int key) {
    if (root == NULL || root->key == key) {
        return root;
    }
    if (key < root->key) {
        return find(root->left, key);
    }
    return find(root->right, key);
}

void inorder(Node* root, int* keys, int* index) {
    if (root != NULL) {
        inorder(root->left, keys, index);
        keys[*index] = root->key;
        (*index)++;
        inorder(root->right, keys, index);
    }
}

void preorder(Node* root, int* keys, int* index) {
    if (root != NULL) {
        keys[*index] = root->key;
        (*index)++;
        preorder(root->left, keys, index);
        preorder(root->right, keys, index);
    }
}

int main() {
    int m;
    scanf("%d", &m);
    Node* root = NULL;
    int keys[1000000];
    int index = 0;
    while (m--) {
        char op[10];
        int key;
        scanf("%s %d", op, &key);
        if (strcmp(op, "insert") == 0) {
            root = insert(root, key);
        } else if (strcmp(op, "find") == 0) {
            Node* node = find(root, key);
            if (node != NULL) {
                printf("yes\n");
            } else {
                printf("no\n");
            }
        } else if (strcmp(op, "print") == 0) {
            inorder(root, keys, &index);
            for (int i = 0; i < index; i++) {
                printf("%d ", keys[i]);
            }
            printf("\n");
            index = 0;
            preorder(root, keys, &index);
            for (int i = 0; i < index; i++) {
                printf("%d ", keys[i]);
            }
            printf("\n");
            index = 0;
        }
    }
    return 0;
}
